import { useEffect, useState} from "react";
import axios from "axios";

const Example = () => {

  const [ useres, setUsers ] = useState([]);

  useEffect(() => {
    const getUser = async () => {
      const res = await axios.get("http://localhost:3003/user");
      setUsers(res.data);
    }
    getUser();
  })
  
};

export default Example;
